import React from 'react';

const Imagen = ({imagen}) => {

    const {largeImageUrl, likes, previewURL, tags, views} = imagen;

    return ( 
        <div className="card card-cascade narrower">

  <div className="view view-cascade overlay">
    <img className="card-img-top" src={largeImageUrl}
        alt="Card image cap"/>
    <a>
      <div class="mask rgba-white-slight"></div>
    </a>
  </div>

  <div className="card-body card-body-cascade">


    <h4 className="font-weight-bold card-title">Cheat day inspirations</h4>

    <p className="card-text">Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit
      laboriosam, nisi ut aliquid ex ea commodi.</p>

    <a className="btn btn-unique">Button</a>

  </div>

</div>
     );
}
 
export default Imagen;
